%pyspark

import re
from pyspark.sql.functions import udf
from pyspark.sql.types import *

def categorize_text(text):
    text = text.lower()
    if re.search("(cancer|chemotherapy|lymphoma|leukemia)",text):
        category = "cancer"
    elif re.search("(diabete|insulin)",text):
        category = "diabetes"
    elif re.search("(arthritis)",text):
        category = "arthritis"
    elif re.search("(asthma)",text):
        category = "asthma"
    elif re.search("(influenza|flu )",text):
        category = "influenza"
    elif re.search("(epilepsy)",text):
        category = "epilepsy"
    elif re.search("(alcohol)",text):
        category = "alcohol"
    elif re.search("(heart disease|cardiovascular|heart attack|heartattack|stint |cholesterol)",text):
        category = "heart disease"
    elif re.search("(hepatitis)",text):
        category = "hepatitis"
    elif re.search("(kidney)",text):
        category = "kidney disease"
    elif re.search("(tuberculosis)",text):
        category = "tuberculosis"
    elif re.search("(respiratory)",text):
        category = "respiratory disease"
    elif re.search("(tumor)",text):
        category = "tumors"
    elif re.search("(hiv )",text):
        category = "hiv"
    elif re.search("( burn )",text):
        category = "burns"
    elif re.search("(dermatitis)",text):
        category = "dermatitis"
    elif re.search("(fasciitis)",text):
        category = "fasciitis"
    elif re.search("(elderly)",text):
        category = "elderly"
    elif re.search("(surgery)",text):
        category = "surgery"
    elif re.search("(probiotics)",text):
        category = "probiotics"
    elif re.search("(biometric)",text):
        category = "biometric"
    elif re.search("(smoker|smoking)",text):
        category = "smoker study"
    elif re.search("(neuro|brain)",text):
        category = "neurological"
    elif re.search("(nerve)",text):
        category = "nerve study"
    elif re.search("(sleep)",text):
        category = "sleep study"
    else:
        category = "Unclassified"

    return category

